Long Description:
The Brother QL1100 is a professional label printer that offers unrivalled versatility not only in the office, but also warehouse, postal, facilities management and other industries. 
Fast print speed, 69 labels per minute;
Prints die cut or continuous rolls up to 102mm wide;
High-quality 300 DPI resolution printing.
P-Touch Editor label design software with barcode print capability.

The Brother QL1110NWB is a professional label printer that offers unrivalled versatility not only in the office, but also warehouse, postal, facilities management and other industries.
AirPrint, USB, Bluetooth 2.1, Wired and WiFi.
Fast print speed, 69 labels per minute;
Prints die cut or continuous rolls up to 102mm wide;
High-quality 300 DPI resolution printing.
P-Touch Editor label design software with barcode print

The QL800 offers two colour printing, in both black and red using DK22251 tapes.
USB connectivity for quick and easy set-up;
Print labels up to 62mm wide from your PC or Mac;
Built-in label editing software doesn't need installing. Simply click to run;
Print in black and red without needing ink or toner;
Print on pre sized labels (for your address or shipping labels) or continuous rolls up to 62mm wide (for indoor/outdoor signage).
